ices with tax included (true) or add the tax at the end (false) in Admin(Invoices)',1,21,'2021-02-03 05:08:25','2020-10-19 19:08:24',NULL,'zen_cfg_select_option(array(\'true\', \'false\'), ',NULL),(19,'Basis of Product Tax','STORE_PRODUCT_TAX_BASIS','Shipping','On what basis is Product Tax calculated. Options are<br />Shipping - Based on customers Shipping Address<br />Billing Based on customers Billing address<br />Store - Based on Store address if Billing/Shipping Zone equals Store zone',1,21,NULL,'2020-10-19 19:08:24',NULL,'zen_cfg_select_option(array(\'Shipping\', \'Billing\', \'Store\'), ',NULL),(20,'Basis of Shipping Tax','STORE_SHIPPING_TAX_BASIS','Shipping','On what basis is Shipping Tax calculated. Options are<br />Shipping - Based on customers Shipping Address<br />Billing Based on customers Billing address<br />Store - Based on Store address if Billing/Shipping Zone equals Store zone - Can be overridden by correctly written Shipping Module',1,21,NULL,'2020-10-19 19:08:24',NULL,'zen_cfg_select_option(array(\'Shipping\', \'Billing\', \'Store\'), ',NULL),(21,'Sales Tax Display Status','STORE_TAX_DISPLAY_STATUS','1','Always show Sales Tax even when amount is $0.00?<br />0= Off<br />1= On',1,21,'2021-02-03 11:16:00','2020-10-19 19:08:24',NULL,'zen_cfg_select_option(array(\'0\', \'1\'), ',NULL),(22,'Show Split Tax Lines','SHOW_SPLIT_TAX_CHECKOUT','false','If multiple tax rates apply, show each rate as a separate line at checkout',1,22,NULL,'2020-10-19 19:08:24',NULL,'zen_cfg_select_option(array(\'true\', \'false\'), ',NULL),(23,'PA-DSS Admin Session Timeout Enforced?','PADSS_ADMIN_SESSION_TIMEOUT_ENFORCED','1','PA-DSS Compliance requires that any Admin login sessions expire after 15 minutes of inactivity. <strong>Disabling this makes your site NON-COMPLIANT with PA-DSS rules, thus invalidating any certification.</strong>',1,30,'2020-10-19 19:08:24','2020-10-19 19:08:24',NULL,'zen_cfg_select_drop_down(array(array(\'id\'=>\'0\', \'text\'=>\'Non-Compliant\'), array(\'id\'=>\'1\', \'text\'=>\'On\')),',NULL),(24,'PA-DSS Strong Password Rules Enforced?','PADSS_PWD_EXPIRY_ENFORCED','1','PA-DSS Compliance requires that admin passwords must be changed after 90 days and cannot re-use the last 4 passwords. <strong>Disabling this makes your site NON-COMPLIANT with PA-DSS rules, thus invalidating any certification.</strong>',1,30,'2020-10-19 19:08:24','2020-10-19 19:08:24',NULL,'zen_cfg_select_drop_down(array(array(\'id\'=>\'0\', \'text\'=>\'Non-Compliant\'), array(\'id\'=>\'1\', \'text\'=>\'On\')),',NULL),(25,'PA-DSS Ajax Checkout?','PADSS_AJAX_CHECKOUT','1','PA-DSS Compliance requires that for some inbuilt payment methods, that we use ajax to draw the checkout confirmation screen. While this will only happen if one of those payment methods is actually present, some people may want the traditional checkout flow <strong>Disabling this makes your site NON-COMPLIANT with PA-DSS rules, thus invalidating any certification.</strong>',1,30,'2020-10-19 19:08:24','2020-10-19 19:08:24',NULL,'zen_cfg_select_drop_down(array(array(\'id\'=>\'0\', \'text\'=>\'Non-Compliant\'), array(\'id\'=>\'1\', \'text\'=>\'On\')),',NULL),(26,'Customer <em>Place Order</em>: Single Admin ID','EMP_LOGIN_ADMIN_ID','0','Identify the ID number of an admin that is permitted to use the <em>Place Order</em> feature on the customers list, regardless of their assigned admin-profile. Set the value to 0 to disable the <em>Single Admin ID</em> feature.',1,300,NULL,'2020-10-19 19:08:24',NULL,NULL,NULL),(27,'Customer <em>Place Order</em>: Passwordless Login','EMP_LOGIN_AUTOMATIC','false','Login directly to store without entering credentials',1,302,NULL,'2020-10-19 19:08:24',NULL,'zen_cfg_select_option(array(\'true\', \'false\'),',NULL),(28,'Customer <em>Place Order</em>: Admin Profiles','EMP_LOGIN_ADMIN_PROFILE_ID','0','Identify the admin <em>User Profile IDs</em> that are permitted to use the <em>Place Order</em> feature on the customers list &mdash; all admins that are in these profiles are permitted. Enter the value as a comma-separated list (intervening blanks are OK) of Admin Profile IDs, e.g. <b>1, 2, 3</b>. Set the value to 0 to disable the <em>Admin Profiles</em> feature.<br><br><b>Default: 0 </b>',1,301,NULL,'2020-10-19 19:08:24',NULL,NULL,NULL),(29,'Admin Session Time Out in Seconds','SESSION_TIMEOUT_ADMIN','900','Enter the time in seconds.<br />Max allowed is 900 for PCI Compliance Reasons.<br /> Default=900<br />Example: 900= 15 min <br /><br />Note: Too few seconds can result in timeout issues when adding/editing products',1,40,NULL,'2020-10-19 19:08:24',NULL,NULL,NULL),(30,'Admin Set max_execution_time for processes','GLOBAL_SET_TIME_LIMIT','60','Enter the time in seconds for how long the max_execution_time of processes should be. Default=60<br />Example: 60= 1 minute<br /><br />Note: Changing the time limit is only needed if you are having problems with the execution time of a process',1,42,NULL,'2020-10-19 19:08:24',NULL,NULL,NULL),(31,'Show if version update available','SHOW_VERSION_UPDATE_IN_HEADER','true','Automatically check to see if a new version of Zen Cart is available. Enabling this can sometimes slow down the loading of Admin pages. (Displayed on main Index page after login, and Server Info page.)',1,44,NULL,'2020-10-19 19:08:24',NULL,'zen_cfg_select_option(array(\'true\', \'false\'), ',NULL),(32,'Store Status','STORE_STATUS','0','What is your Store Status<br />0= Normal Store<br />1= Showcase no prices<br />2= Showcase with prices',1,25,NULL,'2020-10-19 19:08:24',NULL,'zen_cfg_select_option(array(\'0\', \'1\', \'2\'), ',NULL),(33,'Server Uptime','DISPLAY_SERVER_UPTIME','true','Displaying Server uptime can cause entries in error logs on some servers. (true = Display, false = don\'t display)',1,46,'2003-11-08 20:24:47','0001-01-01 00:00:00','','zen_cfg_select_option(array(\'true\', \'false\'),',NULL),(34,'Missing Page Check','MISSING_PAGE_CHECK','Page Not Found','Zen Cart can check for missing pages in the URL and