atus','MODULE_PAYMENT_PAYPALWPP_REFUNDED_STATUS_ID','1','Set the status of refunded orders to this value. <br /><strong>Recommended: Pending[1]</strong>',6,25,NULL,'2021-02-05 09:41:50','zen_get_order_status_name','zen_cfg_pull_down_order_statuses(',NULL),(644,'PayPal Page Style','MODULE_PAYMENT_PAYPALWPP_PAGE_STYLE','Primary','The page-layout style you want customers to see when they visit the PayPal site. You can configure your <strong>Custom Page Styles</strong> in your PayPal Profile settings. This value is case-sensitive.',6,25,NULL,'2021-02-05 09:41:50',NULL,NULL,NULL),(645,'Store (Brand) Name at PayPal','MODULE_PAYMENT_PAYPALWPP_BRANDNAME','Fortech Services Pty Limited','The name of your store as it should appear on the PayPal login page. If blank, your store name will be used.',6,25,NULL,'2021-02-05 09:41:50',NULL,NULL,NULL),(646,'Payment Action','MODULE_PAYMENT_PAYPALWPP_TRANSACTION_MODE','Final Sale','How do you want to obtain payment?<br /><strong>Default: Final Sale</strong>',6,25,NULL,'2021-02-05 09:41:50',NULL,'zen_cfg_select_option(array(\'Auth Only\', \'Final Sale\'), ',NULL),(647,'Transaction Currency','MODULE_PAYMENT_PAYPALWPP_CURRENCY','Only AUD','Which currency should the order be sent to PayPal as? <br />NOTE: if an unsupported currency is sent to PayPal, it will be auto-converted to USD (or GBP if using UK account)<br /><strong>Default: Selected Currency</strong>',6,25,NULL,'2021-02-05 09:41:50',NULL,'zen_cfg_select_option(array(\'Selected Currency\', \'Only USD\', \'Only AUD\', \'Only CAD\', \'Only EUR\', \'Only GBP\', \'Only CHF\', \'Only CZK\', \'Only DKK\', \'Only HKD\', \'Only HUF\', \'Only JPY\', \'Only NOK\', \'Only NZD\', \'Only PLN\', \'Only SEK\', \'Only SGD\', \'Only THB\', \'Only MXN\', \'Only ILS\', \'Only PHP\', \'Only TWD\', \'Only BRL\', \'Only MYR\', \'Only TRY\', \'Only INR\'), ',NULL),(648,'Allow eCheck?','MODULE_PAYMENT_PAYPALEC_ALLOWEDPAYMENT','Instant Only','Do you want to allow non-instant payments like eCheck/EFT/ELV?',6