dor','MODULE_PAYMENT_PAYPALWPP_PFVENDOR','','Your merchant login ID that you created when you registered for the Payflow Pro account. This value is case-sensitive.',6,25,NULL,'2021-02-05 09:41:50',NULL,NULL,NULL),(656,'PAYFLOW: Password','MODULE_PAYMENT_PAYPALWPP_PFPASSWORD','','The 6- to 32-character password that you defined while registering for the account. This value is case-sensitive.',6,25,NULL,'2021-02-05 09:41:50','zen_cfg_password_display','zen_cfg_password_input(',NULL),(657,'PayPal Mode','MODULE_PAYMENT_PAYPALWPP_MODULE_MODE','PayPal','Which PayPal API system should be used for processing? <br /><u>Choices:</u><br /><font color=green>For choice #1, you need to supply <strong>API Settings</strong> above.</font><br /><strong>1. PayPal</strong> = Express Checkout with a regular PayPal account<br />or<br /><font color=green>for choices 2 &amp; 3 you need to supply <strong>PAYFLOW settings</strong>, below (and have a Payflow account)</font><br /><strong>2. Payflow-UK</strong> = Website Payments Pro UK Payflow Edition<br /><strong>3. Payflow-US</strong> = Payflow Pro Gateway only<!--<br /><strong>4. PayflowUS+EC</strong> = Payflow Pro with Express Checkout-->',6,25,NULL,'2021-02-05 09:41:50',NULL,'zen_cfg_select_option(array(\'PayPal\', \'Payflow-UK\', \'Payflow-US\'), ',NULL),(658,'Debug Mode','MODULE_PAYMENT_PAYPALWPP_DEBUGGING','Off','Would you like to enable debug mode?  A complete detailed log of failed transactions will be emailed to the store owner.',6,25,NULL,'2021-02-05 09:41:50',NULL,'zen_cfg_select_option(array(\'Off\', \'Alerts Only\', \'Log File\', \'Log and Email\'), ',NULL),(659,'PayPal Merchant ID','MODULE_PAYMENT_PAYPALWPP_MERCHANTID','','Enter your PayPal Merchant ID here. This is used for the more user-friendly In-Context checkout mode. You can obtain this value by going to your PayPal account, clicking on Profile and navigating to the My Business Info section; You will find your Merchant Account ID on that screen. A typical merchantID looks