INSERT INTO `email_archive` VALUES (1,'James Huang','james@fortech.com.au','Fortech','info@fortech.com.au','test','<html>\n<head>\n<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" />\n<meta name=\"viewport\" content=\"width=device-width, initial-scale=1.0\" />\n<base href=\"http://www.sparepartsforlaptop.com.au/\" />\n\n<style type=\"text/css\">\nbody {background-color:#ffffff; color:#000000; font-family:Verdana, Arial, Helvetica, sans-serif; text-align:center; width:552px;/*logo width+border*/}\na:link {color:#0066cc;}\na:hover {background-color:#eeeecc; color:#0066cc;}\na:visited {color:#0066cc;}\n.holder {background-color:#f9f9f9; border:1px solid #9a9a9a; font-size:9px; text-align:left;}\n.header {font-size:10px; padding:0;}\n.content {font-size:10px; padding:5px;}\n.content-line {padding:5px;}\n#checkout .content-line { font-size: 10px; }\n.footer {border-top:1px solid #9a9a9a; font-size:9px; margin-top:10px; text-align:center;}\n.disclaimer {background-color:#f9f9f9; border:1px solid #cccccc; font-size:10px; margin-top:10px;}\n.disclaimer1 {color:#666666; padding:5px;}\n.disclaimer1 a:link {color:#666666;}\n.disclaimer1 a:visited {color:#666666;}\n.disclaimer2 {color:#666666; padding:5px;}\n.copyright {border-bottom:0 solid #9a9a9a; padding:5px;}\n.extra-info {background-color:#cccc99; border:1px solid #9a9a9a; font-size:10px; margin-top:10px; padding:5px;}\n.extra-info-bold {font-weight:bold;}\n\n.unsubscribe {border-bottom:1px solid #9a9a9a; padding:5px;}\n.gv {background-color:#66FF99; border:1px #9a9a9a; padding:2px; font-size:10px; }\n.gv-amount {font-weight:bold; color:#669966;}\n.gv-code {font-weight:bold; color:#66CC66;}\n.store-name {font-size:13px; padding:5px;}\n.coupon-block { padding: 5px; border: 1px #cccccc solid; background-color: #FFFF99; }\n.coupon-code {font-weight:bold;}\n.gv-block { padding: 5px; border: 1px #cccccc solid; background-color: #99FF99; }\n.content-line-title {font-weight:bold; font-size:11px; padding-top:3px;}\n.order-detail-area {background-color:#CCCC99; border:1px #9a9a9a; width:542px; padding:2px; font-size:10px; }\n.product-details {font-size:10px;}\n.product-details-num {font-size:10px; font-weight:bold;}\n.order-totals-text {font-size:10px; font-weight:bold;}\n.order-totals-num {font-size:10px; }\n.comments {background-color:#FF6699; border:1px #9a9a9a; width:542px; padding:2px; font-size:10px; }\n.address-block {background-color:#E4E8F3; border:1px solid #9a9a9a; margin-top:3px;}\n.address {font-size:10px;}\n.payment-detail, .payment-footer {font-size:10px;}\n.delivery-block, .billing_block { width: 50%; vertical-align: top; }\n\n@media only screen and (max-width:640px){\n  .extra-info, .delivery-block, .billing-block {width:100%; margin:0; }\n  .holder, .header, .content, .footer, .disclaimer, .gv { width: 100%; }\n  .comments, .order-detail-area { width: 95%; }\n  .billing-block, .delivery-block { float:left; }\n  .billing-block { border-top:1px solid #9a9a9a; margin-top:5px; }\n}\n</style>\n\n</head>\n\n<body id=\"direct_mail\">\n<div class=\"holder\">\n\n  <!-- Header Section -->\n  <div class=\"header\">\n    <img src=\"http://www.sparepartsforlaptop.com.au/email/header.jpg\" alt=\"Zen Cart! The Art of E-commerce\" title=\"Zen Cart! The Art of E-commerce\" width=\"550\" height=\"110\" border=\"0\" />\n    \n  </div>\n\n\n  <!-- Content Section -->\n  <div class=\"content\">\n    <div>Dear James Huang</div>\n    <div>test</div>\n  </div>\n\n\n  <!-- Footer Section -->\n  <div class=\"footer\">\n    <div class=\"copyright\">Copyright (c) 2021 <a href=\"https://www.laptopskeyboard.co.nz/\">Fortech</a>. Powered by <a href=\"https://www.laptopskeyboard.co.nz/\">Fortech</a></div>\n  </div>\n\n</div>\n<div class=\"disclaimer\">\n  <div class=\"disclaimer1\">\nThis email address was given to us by you or by one of our customers. If you feel that you have received this email in error, please send an email to <a href=\"mailto:info@fortech.com.au\">info@fortech.c