INSERT INTO `fortech_products_extra_messages` VALUES (1,'w',1,'WARRANTY KBS 6MONTHS','<font color=red><b>All keyboards are brand new Genuine brand and/or OEM manufacturer compatible replacement with 6 Months RTB Warranty.\r\n<BR/>\r\n<br/>\r\nProblem or Question for replace and install your keyboard? Please call us 1300 551 224\r\n<br/>\r\nLaptop keyboard replace/Install services available.</b></font>',1,'2008-07-07 21:23:57','2014-11-22 21:26:45'),(2,'p',1,'KBS Part replacement','<font color=blue><b>This laptop keyboard can replace the following part numbers:</b></font>',1,'2008-07-07 21:25:48','2011-02-12 23:31:50'),(3,'m',1,'KBS Part compatible','<font color=blue><b>This laptop keyboard is also compatible with the following models:</b></font>',1,'2008-07-07 21:26:22','2011-02-12 23:32:00'),(4,'d',1,'Disclaimer','<font color=black>Disclaimer:<br>The laptop keyboard supplied by our Company are [replacement for] sold for use with certain products of computer manufacturers, and any reference to products or trademarks of such companies is purely for the purpose of identifying the computers with which our products [are replacement for] may be used. Our Company and this Web site are neither affiliated with, authorized by, licensed by, distributors for, nor related in any way to these computer manufacturers, nor are the products offered for sale through our web site manufactured by or sold with the authorization of the manufacturers of the computers with which our products [are replacement for] may be use.</font>',1,'2008-07-07 21:27:46','2010-04-10 00:11:32'),(12,'w',2,'OEM warranty, 1 Year,not for battery','<font color=red><b>All products are new [OEM] Products by highest quality , 1 year Warranty.</b></font>',1,'2008-07-12 19:21:40','2014-08-02 21:04:57'),(16,'w',3,'Warranty KBS Used','<font color=red><b>The keyboards RENEW ITEM (but key re-new) or USED PARTS with 30 days RTB Warranty.\r\n<BR/>\r\n<br/>\r\nProblem or Question for replace and install your keyboard? Please call us 1300 551 224\r\n<br/>\r\nLaptop keyboard replace/Install services available.</b></font>',1,'2012-09-04 18:03:54','2014-08-02 21:06:46'),(18,'p',3,'USED PARTS REPLACEMENT','<font color=blue><b>This laptop parts compatible or replace with following part numbers (only for Reference only):</b></font>',1,'2013-08-13 20:20:46','0000-00-00 00:00:00'),(19,'w',4,'USED PARTS WARRANTY 30DAYS','<font color=red><b>This parts was pull from a working laptop and tested, 30 days RTB Warranty.\r\n<BR/>\r\n<br/>\r\nProblem or Question for replace and install your laptop parts need? Please call us 1300 551 224 or email info@fortech.com.au\r\n<br/>\r\n<br/>\r\nlaptop repair services include notebook repair, screen repair, component-level repair, power jack repair and spyware or virus removal.</b></font>',1,'2013-08-13 20:27:55','2013-08-13 20:30:05'),(20,'w',5,'Warranty - PowerBank','<font color=red><b>This item of products is new, Products build with highest quality Korea‚Äôs cells (Samsung/LG Cells), and 12 Months back to base Warranty only.</b></font>',1,'2014-08-02 21:05:53','0000-00-00 00:00:00'),(21,'w',6,'New Parts Wannaty','<font color=red><b>This parts brand new and original parts. original replacement with 3 Months return to base Warranty.\r\n<BR/>\r\n<br/>\r\nProblem or Question for replace and install your keyboard? Please call us 1300 551 224\r\n<br/>\r\nLaptop repair and systems recovery services available.</b></font>',1,'2014-11-22 21:30:19','0000-00-00 00:00:00'),(22,'m',2,'New Parts Compatible','<font color=blue><b>This laptop original replacement parts is also compatible and suitable with the following models:</b></font>',1,'2014-11-22 21:32:07','0000-00-00 00:00:00'),(23,'p',4,'New Parts Replacement','<font color=blue><b>This new and original laptop replacement parts can replace the following part numbers:</b></font>',1,'2014-11-22 21:33:45','0000-00-00 00:00:00');
